:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Sarah and HUTTON, Thomas Biddulph
  JHUTTON, George Thomas Frederick and BARTON, Catherine Carne
  JHUTTON, Edward George and ARNDT, Alice May
  JHUTTON, Noel Edward and TE WHARE, Hiamoe (Barbara)
  01> HUTTON, Noel Edward m on 05.06.1948 to TE WHARE, Hi amoe (Barbara)
  b 23.12.1920 d 30.10.1993
  b 21.09.1928
  Noel b. at Martinborough and m. at St Peter's Church, Onehunga. Divorced. Hiamoe, d/o Nika Te Whare and
  Hana Tahatika, b, at Te Kuiti. Address: (Noel) 33 Northall Road, New Lynn, Auckland.
  Noel joined the Territorials at 17 and served for four years in the artillery. He joined the RNZ Navy
  in 1942 and served for four years in the Pacific mostly on Fairmiles. After the war he completed his
  apprenticeship as a brass moulder and worked as a fitter welder with Wormald Bros, Noel retired in
  1983. Barbara was a nurse.
  01> HUTTON, Alexia Lynnette m on 20.06.1970 to BRESSOLLES, Michel Paul
  Marie
  b 08.05.1949
  b 15.08.1948
  Alexia b. at Auckland and m. at Zion Hill Church, Birkenhead, Auckland. Michel, s/o Raphael
  (Michel) Bressolles (b. 30.09.1913, d. 18.09.1972) and Helene Henriette Vie (b. 26.09.1921), b. at
  Dalat, Indo-China (now South Vietnam). Address: 4a Roberts Road, Glenfield, Auckland.
  Alexia was a shorthand typist before marriage. Michel was a technical geologist in New Caledonia
  until 1983 when he and Alexia bought a beef farm at Helensville. He also assisted with business
  contacts between New Zealand and the French Pacific for a few years.
  01> BRESSOLLES, Shane Michel m on 21.03.1998 to ANDERSON, Sian
  b 01.05.1971
  b ** ** ****
  Shane b. at Auckland and m. at Papakura. Sian, d/o Malcolm and Dale Anderson.
  02> BRESSOLLES, Barbara Lise
  b 13.02.1977
  Barbara b. at Noumea, New Caledonia. She is studying Law at the University of Auckland.
  03> BRESSOLLES, Karen Marie
  b 02.09.1978
  Karen b. at Noumea, New Caledonia. She is studying Physiotherapy at the Auckland Institute of
  Technology.
  02> HUTTON, Karl Edward m on 18.12.1971 to TOMS, Mary Olive
  b 14.07.1950
  b 21.06.1949
  Karl 6. at Auckland and m. at All Saints Church, Birkenhead, Auckland. Mary, d/o Godfrey Donald
  Toms and Olive Lillian Gonzalez, b. at Portsmouth, England. Address: 1/8 Kawerau Avenue, Devonport,
  Auckland.
  Karl trained as a civil engineering technician and in 1982 he joined the Royal New Zealand Navy as
  a works officer. He retired with the rank of Commander in 1997. Later that year he took a
  position with the Ministry of Education as the Auckland District Property Manager.
  Mary trained as a secondary school teacher. She completed a Bachelor of Arts degree in 1990 at
  Auckland University and is currently studying for her Masters in Education Administration.
  Karl and Mary separated in 1995.
  01> HUTTON, Kristen Mere
  b 15.05.1977
  Kristen b. at Auckland. She is studying Business at the Auckland Institute of Technology.
  02> HUTTON, Daryl Eru
  b 04.10.1979
  Daryl b. at Auckland. He is studying Landscape Architecture at Lincoln University.
